import React from "react" 

class Ellipses extends React.Component {
  constructor(props) {
    super(props) 

  }
  
  render() {
    let {maxLength, page, id, arrOfPages} = this.props
    if (page <= maxLength && id == 0) {
      return null
    } else if (page >= arrOfPages.length - maxLength && id == 1)
    return <div className="ellipses">. . .</div>
  }

}

export default Ellipses
